import React from "react";
import "./Hero.css";

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>Welcome to Osumare</h1>
        <p>Your trusted digital marketing partner</p>
        <button>Get Started</button>
      </div>
    </section>
  );
};

export default Hero;
